          updated_at: "2023-12-04 20:01:13",
          photos: '["1682346448.png"]',
          description:
            "<p>Заранее достаем сливочное масло, чтобы оно стало мягким</p>\r\n<p>Основа для чизкейка (печенье)<br><br>Мука - 100<br>Овсянка - 200<br>Сахар - 60<br>Масло слив - 120<br>Молоко - 50 гр<br>Сода - 4 гр<br>Соль - 0.5 гр<br>Ванилин - 10 гр<br><br>1. Все кроме муки, перебиваем в блендере на большой скорости до однородной массы (см. фото)<br>2. Пересыпаем массу в миску, добавляем муку, хорошо вымешиваем до однородной масс</p>\r\n<p>3. Формируем корж толщиной ~ 0.5 см</p>\r\n<p>4. Ставим на программу Печенье<br>5. После даем остыть (см. фото)</p>\r\n<p>Печенье и сливочное масло погружаем в каттер и перебиваем на 2-3 скорости<br>3. Полученную массу равномерно распределяем в гастроемкости глубиной&nbsp; 40мм (GN 40)</p>\r\n<p>4. Ставим в охлажденный чиллер, чтобы масса стала твердой.</p>\r\n<p><br><br>Масса для чизкейка<br><br>1. Все ингредиенты перебиваем в каттере постепенно с 1 до 5 скорости до консистенции с отсутствием крупинок (см. фото)<br>2. Замачиваем желатин на 10 минут в воде. (На 50 гр желатина - 200 гр воды)</p>\r\n<p>3. Ставим желатин на плиту, разогреваем, пока желатин полностью не растворится, постоянно помешивая (см. фото до и после)</p>\r\n<p>4. Растворенный желатин тонкой струйкой вливаем в творожную массу, при этом саму массу постоянно помешиваем венчиком.&nbsp;</p>\r\n<p>5. Полученную массу с желатином выливаем на основу для чизкейка и равномерно распределяем</p>\r\n<p>6. Ставим в охлажденный чиллер до застывания (главное не заморозить!).</p>\r\n<p>Топпинг</p>\r\n<p>1. Берем манго, очищаем и кладем в блендер. Добавляем пюре из маракуйи (см. фото) и все вместе перебиваем на большой скорости до однородной массы (см. фото)</p>\r\n<p>2. Берем две маленькие емкости: в одной смешиваем сахар и пектин, в другой - разводим лимонную кислоту с 2 граммами воды.</p>\r\n<p>3. Пюре из манго и маракуйи выливаем в кастрюлю и ставим на плиту</p>\r\n<p>4. На слабом или среднем огне доводим до 40 градусов (проверяем щупом), затем всыпаем пектин с сахаром, включаем максимальный огонь и постоянно помешивая венчиком доводим до кипения и кипятим в течение 1 минуты. (см. фото)</p>\r\n<p>5. Снимаем с плиты и сразу добавляем разведенную лимонную кислоту<br>6. Полученную массу выливаем на застывшую массу для чизкейка и равномерно распределяем<br>7. Даем застыть в холодильнике или чиллере</p>",
