          photos: '["1682344299.png"]',
          description:
            "<p><span style=\"font-size: 16px; font-family: 'Times New Roman';\">1. Тыкву зачищаем, нарезаем на каттере средним кубиком. Выкладываем на перфорированный противень в один слой<br /></span><span style=\"font-size: 16px; font-family: 'Times New Roman';\">Мультитайм-крупы/овощи-+Режим &laquo;Тыква&raquo;</span></p>\r\n<p>2. <span style=\"font-family: 'Times New Roman'; font-size: 12pt;\">Помидоры нарезаем кольцами толщиной 5мм (см. фото)</span></p>\r\n<p><span style=\"font-size: 12.0pt; line-height: 107%; font-family: 'Times New Roman'; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-ansi-language: RU; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">&nbsp;Солим, перчим, посыпаем базиликом и запекаем:&nbsp;<strong>&laquo;Шеф Унокс гастрономия&raquo;-гриль-овощи-томаты-5мм</strong>.<br /><br /></span></p>\r\n<p><span style=\"font-size: 12.0pt; line-height: 107%; font-family: 'Times New Roman'; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-ansi-language: RU; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">3. Фасоль<br /><br />Обрезаем концы с двух сторон. Разрезаем на три части. Выкладываем в миску и заливаем водой на 30 минут.<br />Затем наливаем в кастрюлю воду и доводим до кипения.<br />Замоченную фасоль всыпаем в кастрюлю.&nbsp;<br />Один раз перемешиваем.<br />Накрываем крышкой и варим в течение 6 минут<br />Переливаем в перфорированную глубокую емкость.<br />Горячую фасоль перекладываем на плоскую перфорированную гастроемкость и сразу ставим в чиллер.</span></p>",
