          description:
            "<p>1. Творог, сахар и кокосовое молоко перебиваем в каттере до кремообразной массы без крупинок<br />2. Полученную массу делим на две части: часть на нижний, вторую - на верхний</p>\r\n<p>3. Замачиваем желатин (на 50 гр желатина - 200 гр воды).<br />4. Ставим желатин на плиту, разогреваем, пока желатин полностью не растворится, постоянно помешивая (см. фото до и после)<br />5. В нижний слой добавляем кокосовую стружку, экстракт кокоса и 2/3 части растопленного желатина (тонкой струйкой и постоянно помешивая)<br />6. Разливаем по порциям (из расчета на 200 гр - 150 гр)</p>\r\n<p>7. Ставим в чиллер до застывания</p>\r\n<p>Верхний слой<br /><br />8. Во вторую часть творога добавляем кероб.<br />9. Тщательно перемешиваем венчиком, чтобы не было крупинок кероба (если нужно, протираем через сито)<br />10. Вводим тонкой струйкой, постоянно помешивая, желатин.<br />11. Разливаем на застывший нижний слой, равномерно распределяя по поверхности ложкой (из расчета 50 гр на 200 гр)<br />12. Ставим в чиллер до застывания</p>",
