            "<p>1. Промываем рис в кастрюле, в которой будем варить</p>\r\n<p>2. Наливаем полную кастрюлю воды</p>\r\n<p>3. Ставим на максимальный огонь на 1 час<br />4. Солим</p>\r\n<p>5. Через 1 час проверяем на готовность (Если не готов, то варим еще 5-10 минут)</p>\r\n<p>6. После этого переливаем рис в перфорированную глубокую гастроемкость, промываем холодной водой и даем стечь<br />7. Перед раскладкой пробуем и доводим до вкуса солевым раствором, если потребуется<br />8. Заправляем оливковым маслом</p>\r\n<p>&nbsp;</p>",
          allergens: null,
          ingredients_description: "<p>red rice, olive oil</p>",
          deleted_at: null,
          names: {
            id: 468,
            name_ru: "Рис красный",
            name_en: "Red rice",
            name_es: "Arroz rojo",
          },
