            "<p>1. Сырую индейку зачищаем. Полученное филе разрезаем вдоль по центру делим пополам и разворачиваем (см. фото)</p>\r\n<p>2. Выкладываем на противень GN10 (10 мм), смазанный маслом. Посыпаем солью, перцем, орегано, базиликом и чесноком и поливаем оливковым маслом сверху.<br />3. Запекаем на программе Мои Программы - Брускетта<br />4. Даем остыть<br /><br />Овощи<br /><br />1. Помидор нарезаем мелким кубиком (5мм), красный лук нарезаем мелкой крошкой и свежий базилик нарезаем мелко. <br />2. Все смешиваем в миске и добавляем оливковое масло EV и соль.<br /><br />На готовое филе индейки выкладываем овощи, посыпаем тертым пармезаном и поливаем крем-бальзамиком.<br /><br />На 200 гр порции идет 130-140 гр готового филе индейки.<br />На 250 гр 160 - 170 гр<br />На 300 гр - 200 - 210&nbsp; гр</p>\r\n<p>&nbsp;</p>",
          allergens: '["dairy"]',
          ingredients_description:
            "<p>chicken fillet, parmesan, basil, oregano, red onion, balsamic vinegar</p>",
