          updated_at: "2023-06-25 12:14:57",
          photos: '["1687698895.png"]',
          description:
            '<p>1. Болгарский перец чистим от семян и плодоножки. Выкладываем в гастроемкость кожей вверх. (см. фото)<br />2. От помидоров отрезаем "попки". Надрезаем шкурку крест накрест вдоль всего помидора (см. фото). Выкладываем на отдельную гастроемкость.<br />3. К помидорам выкладываем зубчики неочищенного чеснока и перец чили.<br />4. Запекаем: сначала перцы на&nbsp;<strong>250 градусах - жар 100% - время 12 минут - вентилятор 4</strong>. За три минуты до конца программы ставим в пароконвектомат гастроемкость с помидорами. Перцы должны обуглиться (см. фото)<br />5. Перец выкладываем в миску, и накрываем пленкой. Чтобы обугленная кожица легче снималась.<br />6. Миндаль обжариваем на сухой сковороде.&nbsp;<br />7. С помидор и болгарского перца счищаем кожицу. С чеснока удаляем шелуху.<br />8. Затем все ингредиенты, кроме оливкого масла, смешиваем в блендере.<br />9. Масло наливаем в отдельную емкость и в процессе перебивания ингредиентов в блендере вводим масло тонкой струйкой.<br />10. Выливаем в получившуюся массу в миску и даем настояться в течение 2 часов.<br />11. Нарезаем индейку су-вид слайсами 5 мм и смешиваем с соусом.&nbsp;</p>',
