          description:
            "<p>1. Обрезки кадеры нарезаем крупным кубиком<br />2. В кастрюлю наливаем оливковое масло, добавляем нарезанную говядину, слега обжариваем на сильном огне.<br />3. Затем добавляем воду таким образом, чтобы мясо выступало из воды на 2 см.<br />4. Варим до полного размягчения мяса - периодически контролируем количество воды. Когда она испарилась, то доливаем.<br />5. Лук, перец нарезаем средним кубиком 1.5 на 1.5<br />6. В отдельную раскаленную посуду выливаем оливковое масло, добавляем лук и обжариваем 2 минуты<br />7. Добавляем болгарский перец, обжариваем до готовности болгарского перца<br />8. Добавляем мелко нарезанный халапеньо, промытую под холодной водой консервированную фасоль и перетертые томаты (Mutti)</p>\r\n<p>9. Добавляем специи: сахар и соль и тушим на медленном огне в течение 10 минут<br />10. Готовое мясо смешиваем с овощами и соусом.</p>",
