            "<p>1. Лук нарезаем мелким кубиком, помидоры нарезаем средним кубиком 1.5 на 1.5&nbsp;<br>2. В отдельной миске смешиваем рыбный соус, соевый соус<br>3. В раскаленную кастрюлю наливаем масло, кладем репчатый лук и обжариваем до золотистой корочки<br>4. Добавляем тростниковый сахар - жарим в течение 1-2 минут<br>5. Добавляем пасту карри Массаман и обжариваем в течение 1 минуты, чтобы не было крупных комков пасты (чтобы она равномерно распределилась по кастрюле)<br>6. Добавляем помидоры<br>7. Вливаем кокосовое молоко и подготовленную смесь из соусов<br>8. Кукурузный крахмал разводим в воде&nbsp;&nbsp;<br>9. Доводим до кипения массу в кастрюле и тонкой струйкой вводим крахмал, постоянно помешивая до загустения.<br>10. Даем остыть и смешиваем с индейкой, нарезанной слайсами</p>",
